  // 補助漢字 判定
  function is_jisx0212(jis){
    if((jis&0x10000)!==1)return false;
    var k=(jis>>8&0xFF)-0x20;
    if(k<8)
      return k===2||k===6||k===7;
    else if(k<16)
      return k===9||k===10||k===11;
    else
      return k<78;
  }

  function shift_jis(jis){
    var m=jis>>16;
    var k=(jis>>8&0xFF)-0x20;
    var t=(jis&0xFF)-0x20;
    var b1=null,b2;
    if(m===1){
      // 第2面 b1 in [0xF0,0xFC]
      if(k<16){
        if(k<8){
          if(k==1||3<=k&&k<=5)
            b1=k+0x1df>>1;
        }else{
          if(k==8||12<=k&&k<=15)
            b1=(k+0x1df)>>1-3;
        }
      }else{
        if(k<=78&&k<=94)
          b1=k+0x19b>>1;
      }
      // 他: 補助漢字
    }else{
      // 第1面 b1 in [0x81,0x9F] [0xE0,0xEF]
      if(1<=k&&k<=94){
        b1=k+0x101>>1;
        if(k>=63)b1+=0x40;
      }
    }
    if(b1===null)
      return null;
    
    if(1<=t&&t<=94){
      if(k&1){
        b2=t+0x3f;
        if(t>=64)
          b2++;
      }else{
        b2=t+0x9e;
      }

      return b1<<8|b2;
    }else return null;
  }

