        if(s.length==0)continue;

        var uni=parseInt(s,16);
        if(uni==0xFFFF||uni==0xFEFF)continue;

        var jis=i+0x21<<8|j+0x21;
        table[jis]=uni;

        jis|=0x10000;
        sjis2004[shift_jis(jis)]=uni;

        // if(uni in uni2jis)
        //   log("重複 U+"+uni.toString(16)+" "+uni2jis[uni].toString(16)+" "+jis.toString(16));
